import React from 'react';

import { Navbar, Nav, NavItem } from 'reactstrap';

import SourceLink from 'components/SourceLink';

const Footer = () => {
  return (
    <Navbar>
      <Nav navbar>
        <NavItem>
          201, source on <SourceLink></SourceLink>
        </NavItem>
      </Nav>
    </Navbar>
  );
};

export default Footer;
